import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export class Blog extends Component {
  render() {
    return (
      <Router>
        <Link to="ReadMore">Read More</Link>
      </Router>
    );
  }
}

export default Blog;
